Two strangers dressed as minstrels arrive at a castle in advance of court
festivities, and are revealed to be emissaries of the devil, dispatched to
spread heartbreak and suffering. Their plans, however, are thwarted by an
unexpected intrusion: human love.
Often interpreted as an allegory for the Nazi occupation of France, during
which it was made, Les visiteurs du soir, is a moving tale of love
conquering all.

